def int_to_mini_roman(number):
    if number < 1 or number > 1000:
        raise ValueError("Number must be between 1 and 1000")

    roman_numeral = ''
    thousands, hundreds, tens, ones = divmod(number, 1000), divmod(hundreds, 100), divmod(tens, 10), number % 10

    if thousands:
        roman_numeral += ROMAN_NUMERALS[thousands[0]] * thousands[1]

    if hundreds:
        roman_numeral += 'c' * hundreds[0]
        if tens or ones:
            roman_numeral += ROMAN_NUMERALS.get(tens[0], '') + ROMAN_NUMERALS.get(ones, '')

    if tens:
        if tens[1] == 4:
            roman_numeral += 'xc'
